import { useEffect, useState } from 'react';



function App() {

 const [data, setData] = useState()

  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/todos/1')
    .then(response => response.json())
    .then(json => setData(json))
  },[setData])

  console.log(data)


  return (
    <div>
     {JSON.stringify(data, null, 2)}
    </div>
  );
}

export default App;
